// --------------------------------------------------
// üîÅ STEP 3 ‚Äî Conversion logic
function convertBoxStructure(structure) {
  if (Array.isArray(structure)) {
    return structure.map(convertBoxStructure);
  } else if (
    structure &&
    typeof structure === "object" &&
    "x" in structure &&
    "y" in structure &&
    "w" in structure &&
    "h" in structure
  ) {
    return {
      xMin: structure.x,
      xMax: structure.x + structure.w,
      yMin: structure.y,
      yMax: structure.y + structure.h,
    };
  } else {
    return structure;
  }
}

